                <div className='top'><h2>{movie.title}</h2></div>
                {/* <h2>{movie.id}</h2> */}
                <div className='middle'><img src={"https://image.tmdb.org/t/p/w500" + movie.backdrop_path } alt={movie.path} /></div>
